import React from "react";
import { Box, Button, Typography, Container } from "@mui/material";
import { Link, useNavigate } from "react-router-dom";
import Footer from "../../components/Footer";
import { Edit, PersonAdd, PersonRemove } from "@mui/icons-material";
import Header from "../../components/Header";
import { Link as RouterLink } from "react-router-dom";

const GestionUsuarios: React.FC = () => {
  const navigate = useNavigate();
  const handleIrACrearNuevo = () => navigate("/crear-nuevo");
  const handleIrAEliminarUsuario = () => navigate("/eliminar-usuario");
  const handleIrAEditarUsuario = () => navigate("/editar-usuario");

  return (
   <Box
         sx={{
           minHeight: "100vh",
           backgroundImage: "url('/fondo.jpg')",
           backgroundSize: "cover",
           backgroundPosition: "center",
           display: "flex",
           flexDirection: "column",
           overflowX: "hidden",
         }}
       >
         <Header />
   
         {/* Bot√≥n Volver */}
         <Box sx={{ display: "flex", justifyContent: "flex-end", mt: 3, px: 4 }}>
           <Button
             component={RouterLink}
             to="/superadmin"
             variant="outlined"
             sx={{
               backgroundColor: "#1565C0",
               color: "#ffffff",
               width: 180,
               letterSpacing: 3,
               fontSize: 20,
               borderRadius: 3,
               mr: 5,
               fontFamily: "Tektur, sans-serif",
               fontWeight: 500,
               textTransform: "none",
             }}
           >
             Volver
           </Button>
         </Box>

      {/* Contenido principal */}
      <Container
        maxWidth="sm"
        sx={{
          mt: 8,
          mb: 8,
          flexGrow: 1,
          display: "flex",
          flexDirection: "column",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <Box
          sx={{
            backgroundColor: "#fff",
            borderRadius: 3,
            boxShadow: "0 4px 12px rgba(0,0,0,0.10)",
            p: 5,
            width: "100%",
            display: "flex",
            flexDirection: "column",
            alignItems: "center",
            gap: 4,
          }}
        >
          <Typography
            variant="h4"
            sx={{
              mb: 3,
              fontFamily: "Tektur, sans-serif",
              fontWeight: 600,
              color: "#333",
              textAlign: "center",
              letterSpacing: 2,
            }}
          >
            Gesti√≥n de Usuarios
          </Typography>

          <Button
            onClick={handleIrACrearNuevo}
            startIcon={<PersonAdd />}
            variant="contained"
            fullWidth
            sx={{
              backgroundColor: "#1976d2",
              color: "#fff",
              borderRadius: 2,
              py: 2,
              fontFamily: "Tektur, sans-serif",
              fontWeight: 600,
              fontSize: 18,
              textTransform: "none",
              boxShadow: "0 2px 8px rgba(0,0,0,0.08)",
              "&:hover": { backgroundColor: "#115293" },
            }}
          >
            Alta Nuevo Usuario
          </Button>
          <Button
            onClick={handleIrAEditarUsuario}
            startIcon={<Edit />}
            variant="contained"
            fullWidth
            sx={{
              backgroundColor: "#1976d2",
              color: "#fff",
              borderRadius: 2,
              py: 2,
              fontFamily: "Tektur, sans-serif",
              fontWeight: 600,
              fontSize: 18,
              textTransform: "none",
              boxShadow: "0 2px 8px rgba(0,0,0,0.08)",
              "&:hover": { backgroundColor: "#115293" },
            }}
          >
            Editar Usuario
          </Button>
          <Button
            onClick={handleIrAEliminarUsuario}
            startIcon={<PersonRemove />}
            variant="contained"
            fullWidth
            sx={{
              backgroundColor: "#1976d2",
              color: "#fff",
              borderRadius: 2,
              py: 2,
              fontFamily: "Tektur, sans-serif",
              fontWeight: 600,
              fontSize: 18,
              textTransform: "none",
              boxShadow: "0 2px 8px rgba(0,0,0,0.08)",
              "&:hover": { backgroundColor: "#115293" },
            }}
          >
            Eliminar Usuario
          </Button>
        </Box>
      </Container>

      <Footer />
    </Box>
  );
};

export default GestionUsuarios;
